import { Food } from "../models/Food";
import { CartFoodElement, SmallImg } from "../style";

export const CartFood = ({ data }: any) => {
  return (
    <CartFoodElement>
      <div style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <SmallImg alt="No img?" src={data.imageUrl} />
      </div>
      <div style={{ flex: 1 }}>
        {data.name} {data.amount} {data.price}$
      </div>
      <div style={{ flex: 1 }}>
        <SmallImg alt="No img?" src={data.imageUrl} />
      </div>
    </CartFoodElement>
  );
};
